import './App.css';

import React from 'react';

class App extends React.Component {

	render(){
    return (
      <div className='App'>
        <h1>Hello ...</h1>
        <input type='text'></input>
        <button>OK</button>
        <h1>Gender</h1>
        <button>Switch Gender</button>
      </div>
    );
  }
}

export default App;
